</pre>

</li>
<li>

<pre>
first = { 'a' }
sep1 = '/'
second = { 'b' }
sep2 = ':'
third = { 'c' }
=&gt; result = { ' a' , '/', 'b' , ':', 'c' }
</pre>

</li>
</ol>

